import React from 'react';
import Tilt from 'react-parallax-tilt';
import brain from './brain.svg';


const Logo = () => {
    return (
        <div className ='ma4 mt0'>
            <Tilt>
                <div style={{ height: '200px', width: '100px',}}>
                <img src={brain} alt='brain illustration logo'/>
                </div>
            </Tilt>
        </div>

    );
}

export default Logo;
